- input: "TEXT\x1CC00105973\x1CTEXT-00001\x1C\x1CF3XA\x1CThis amendment is in response
    to the Commission's request.    1.  The memo Schedule A's for the ASDC Joing Victory
    joint fundraising committee were included on the 2008 Post General Report with
    a text record labeling each receipt.     2-3.  The totals on Schedule L have been
    corrected.    4.  The ratio for HRC Rally has been corrected on Schedule H2.    5.
    \ The ratio for ER Award Lunch is included on Schedule H2 because an H3 disbursement
    was made on that ratio during the period.  This report does not contain any disbursements
    on Line 30b because no employee spent over 25% of their compensated time on Federal
    activity.        This report includes Memo Schedule A entries for contributions
    raised by the ASDC Partnership and Dollars for Democrats programs.  The committee
    has not received its share of the proceeds as of the end of the reporting period.
    \ The committee expects to receive the transfer at some point in the three months
